              <Route path="/giphy-detail/:id" component={ GiphyDetail }/>
              <Route path="/history" component={History}/>
              <Route component={ NotFound }/> */}
            </Switch>
          </BrowserRouter>
        </div>
      </Provider>
    )
  }
}

export default App;
